const Styled = styled.section``


// import Link from 'next/link';

const IndexPage = () => (
  <Layout heroSize={true} banner='home'>
        <About />
        <ImgBanner title='PRIVATE EVENTS' subtile='Planning a party? Let us do the work' btnTitle='view more' toLink='/privateEvents' />

    </Layout>
);

export default IndexPage;
